import './App.css';
import {Component} from 'react'

class App extends Component{
  constructor(props){
    super(props);
    this.state = {apiResponse:""};
  }

  callAPI(){
    fetch("http://localhost:9000/testAPI")
        .then(res => res.text())
        .then(res => this.setState({apiResponse:res}))
        .catch(err => err);
  }

  componentDidMount(){
    this.callAPI();
  }

  render(){
    return (
      <div className="App">
        <p className="App-test">{this.state.apiResponse}</p>
      </div>
    );
  }
}



export default App;
